    #                 j += 1
    #             temp = temp[:i]+temp[i+1:j]+temp[j+1:]
    #             l = len(temp)
    #     else:
    #         while l > 1:
    #             i, j = 0, 1
    #             while j<l and temp[i] == temp[j]:
    #                 j += 1
    #             temp = temp[:i]+temp[i+1:j]+temp[j+1:]
    #             l = len(temp)
    #     return temp[0]
    def majorityElement(self, nums):  # Cost time: 0.00705504417419
        dic = dict()
        max, result = 1, nums[0]
        for num in nums:
            if num not in dic:
                dic[num] = 1
            else:
                dic[num] += 1
                if dic[num] > max:
                    max = dic[num]
                    result = num
        return result

